import React from 'react';
import './Team.css';

const Team = () => {
  return (
    <div className="team-page">
      <div className="page-header">
        <h1>Team</h1>
      </div>
      <div className="team-content">
        <p>Team management interface coming soon...</p>
      </div>
    </div>
  );
};

export default Team;
